import React from "react";
import ReactDOM from "react-dom";
import { Menu, Icon, Form, Layout } from 'antd';

const SubMenu = Menu.SubMenu;
const MenuItemGroup = Menu.ItemGroup;

class AccountSettings extends React.Component {
  handleClick = (e) => {
    console.log('click ', e);
  }

  render() {
    return (
      <Layout>
      <Menu
        onClick={this.handleClick}
        style={{ width: 200 }}
        defaultSelectedKeys={['1']}
        defaultOpenKeys={['sub1']}
        mode="inline"
      >
        <SubMenu key="sub1" title={<span><Icon type="mail" /><span>Navigation One</span></span>}>
          <MenuItemGroup key="g1" title="Account Setting">
            <Menu.Item key="1">
            <Content style={{ padding: '0 24px', minHeight: 280 }}>
              <a href="/signup">
              <Icon type="user-add" />Create Account
              </a>
            </Content>
            </Menu.Item>
            <Menu.Item key="2">Basic Setting</Menu.Item>
            <Menu.Item key="3">Privacy Settings</Menu.Item>
          </MenuItemGroup>
        </SubMenu>

      </Menu>
      </Layout>
    );
  }
}

const AccSettings = Form.create()(AccountSettings);
export default AccSettings;
